export function OrbitCard() {
  return (
    <div className="relative flex max-h-[500px] min-h-[500px] w-full max-w-[32rem] items-center justify-center overflow-hidden bg-background md:shadow-xl">
      <span className="pointer-events-none whitespace-pre-wrap bg-gradient-to-b from-black to-gray-300/80 bg-clip-text text-center text-8xl font-semibold leading-none text-transparent dark:from-white dark:to-slate-900/10">
        One Link
      </span>

      {/* Inner Circles */}
      <OrbitingCircles
        className="h-[30px] w-[30px] border-none bg-transparent"
        duration={20}
        delay={20}
        radius={80}
      >
        <Icons.whatsapp />
      </OrbitingCircles>
      <OrbitingCircles
        className="h-[30px] w-[30px] border-none bg-transparent"
        duration={20}
        delay={50}
        radius={80}
      >
        <Icons.notion />
      </OrbitingCircles>

      <OrbitingCircles
        className="h-[30px] w-[30px] border-none bg-transparent"
        duration={60}
        delay={30}
        radius={80}
      >
        <Icons.linkedIn />
      </OrbitingCircles>

      <OrbitingCircles
        className="h-[30px] w-[30px] border-none bg-transparent"
        duration={30}
        delay={110}
        radius={80}
      >
        <Icons.x />
      </OrbitingCircles>
      
      {/* Outer Circles (reverse) */}
      <OrbitingCircles
        className="h-[50px] w-[50px] border-none bg-transparent"
        reverse
        radius={190}
        duration={20}
        delay={20} // Keep this delay
      >
        <Icons.googleDrive />
      </OrbitingCircles>
      <OrbitingCircles
        className="h-[50px] w-[50px] border-none bg-transparent"
        reverse
        radius={190}
        duration={20}
        delay={50} // Adjusted delay
      >
        <Icons.gitHub />
      </OrbitingCircles>

      <OrbitingCircles
        className="h-[50px] w-[50px] border-none bg-transparent"
        reverse
        radius={190}
        duration={60}
        delay={30} // Adjusted delay
      >
        <Icons.instagram />
      </OrbitingCircles>

      
      <OrbitingCircles
        className="h-[50px] w-[50px] border-none bg-transparent"
        reverse
        radius={190}
        duration={30}
        delay={110} // Adjusted delay
      >
        <Icons.facebook />
      </OrbitingCircles>
    </div>
  );
}


